-- ----------------------------
-- View structure for pagare_transactions
-- ----------------------------
DROP VIEW IF EXISTS `pagare_transactions`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pagare_transactions` AS select `pagare`.`folio` AS `folio`,`pagare`.`id` AS `id`,`pagare`.`from_pagare_id` AS `parent_id`,`pagare`.`monto` AS `amount`,`pg_ant`.`monto` AS `parent_amount`,`pagare`.`fecha_suscripcion` AS `starting_date`,`pg_ant`.`fecha_suscripcion` AS `parent_starting_date`,(to_days(`pagare`.`fecha_suscripcion`) - to_days(`pg_ant`.`fecha_suscripcion`)) AS `days_in_gap`,(to_days(`pagare`.`fecha_vencimiento`) - to_days(`pagare`.`fecha_suscripcion`)) AS `lifetime_days`,(case when (`pg_ant`.`monto` = `pagare`.`monto`) then 0 else abs((`pagare`.`monto` - `pg_ant`.`monto`)) end) AS `amount_distinct`,(case when (`pg_ant`.`monto` = `pagare`.`monto`) then 'renewal' when (`pg_ant`.`monto` < `pagare`.`monto`) then 'income' when (`pg_ant`.`monto` > `pagare`.`monto`) then 'outcome' else NULL end) AS `transaction_type`,`divisa`.`abreviacion` AS `currency_short_name`,`tipo_pago`.`nombre` AS `payment_method_name`,(`pagare`.`monto` * (`pagare`.`interes_anual_bruto` / 100)) AS `gross_interest`,(`pagare`.`monto` * (`pagare`.`tasa_retencion` / 100)) AS `gross_income_tax`,(`pagare`.`monto` * (`pagare`.`tasa_neta` / 100)) AS `gross_net_interest`,(`pagare`.`monto` * (`pagare`.`tasa_brocker` / 100)) AS `gross_promoter_fee` from (((`pagare` left join `divisa` on((`divisa`.`id` = `pagare`.`divisa_id`))) left join `pagare` `pg_ant` on((`pagare`.`from_pagare_id` = `pg_ant`.`id`))) left join `tipo_pago_intereses` `tipo_pago` on((`pagare`.`tipo_pago_intereses_id` = `tipo_pago`.`id`)));

-- ----------------------------
-- View structure for tracked_investments
-- ----------------------------
DROP VIEW IF EXISTS `tracked_investments`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `tracked_investments` AS select `pagare`.`from_pagare_id` AS `parent_id`,`pg_ant`.`monto` AS `parent_amount`,`pg_ant`.`fecha_suscripcion` AS `parent_starting_date`,`pagare`.`folio` AS `folio`,`pagare`.`id` AS `id`,`pagare`.`monto` AS `amount`,`pagare`.`fecha_suscripcion` AS `starting_date`,`r`.`monto` AS `withdraw_amount`,`rp`.`tipo` AS `withdraw_type`,`r`.`fecha_retiro` AS `withdraw_date`,`child_p`.`id` AS `child_id`,`child_p`.`monto` AS `child_amount`,`child_p`.`fecha_suscripcion` AS `child_starting_date`,(to_days(`pagare`.`fecha_suscripcion`) - to_days(`pg_ant`.`fecha_suscripcion`)) AS `parent_days_in_gap`,(to_days(`child_p`.`fecha_suscripcion`) - to_days(`pagare`.`fecha_suscripcion`)) AS `child_days_in_gap`,(to_days(`pagare`.`fecha_vencimiento`) - to_days(`pagare`.`fecha_suscripcion`)) AS `lifetime_days`,(case when (`pg_ant`.`monto` = `pagare`.`monto`) then 'renewal' when (`pg_ant`.`monto` < `pagare`.`monto`) then 'income' when (`pg_ant`.`monto` > `pagare`.`monto`) then 'outcome' else NULL end) AS `parent_transaction_type`,(case when (`pg_ant`.`monto` = `pagare`.`monto`) then 0 else abs((`pagare`.`monto` - `pg_ant`.`monto`)) end) AS `parent_amount_distinct`,(case when (`child_p`.`monto` = `pagare`.`monto`) then 'renewal' when (`child_p`.`monto` < `pagare`.`monto`) then 'outcome' when (`child_p`.`monto` > `pagare`.`monto`) then 'income' when (`pagare`.`monto` = `r`.`monto`) then 'outcome' else NULL end) AS `child_transaction_type`,(case when (`child_p`.`monto` = `pagare`.`monto`) then 0 else abs((`pagare`.`monto` - `child_p`.`monto`)) end) AS `child_amount_distinct`,`divisa`.`abreviacion` AS `currency_short_name`,`tipo_pago`.`nombre` AS `payment_method_name`,(`pagare`.`monto` * (`pagare`.`interes_anual_bruto` / 100)) AS `gross_interest`,(`pagare`.`monto` * (`pagare`.`tasa_retencion` / 100)) AS `gross_income_tax`,(`pagare`.`monto` * (`pagare`.`tasa_neta` / 100)) AS `gross_net_interest`,(`pagare`.`monto` * (`pagare`.`tasa_brocker` / 100)) AS `gross_promoter_fee` from ((((((`pagare` left join `divisa` on((`divisa`.`id` = `pagare`.`divisa_id`))) left join `pagare` `pg_ant` on((`pagare`.`from_pagare_id` = `pg_ant`.`id`))) left join `pagare` `child_p` on((`pagare`.`id` = `child_p`.`from_pagare_id`))) left join `tipo_pago_intereses` `tipo_pago` on((`pagare`.`tipo_pago_intereses_id` = `tipo_pago`.`id`))) left join `retiro_pagare` `rp` on(((`pagare`.`id` = `rp`.`pagare_id`) and (`rp`.`tipo` = 'capital')))) left join `retiro` `r` on((`rp`.`retiro_id` = `r`.`id`))) where isnull(`pagare`.`deleted_at`);

